import React from "react";
import { BsFillBackspaceFill, BsStarFill } from "react-icons/bs";

const Movie = ({ movie }) => {
  return (
    <div className="bg-warning rounded m-2">
      <h4 className=" d-flex justify-content-between p-3">
        {movie.priority === true && <BsStarFill />}
        {movie.name}
        <> </>
        <p>
          <BsFillBackspaceFill />
        </p>
      </h4>
    </div>
  );
};

export default Movie;
